import './StyleHeader.css';
import React from 'react';

const Header = ()=>{
    return <div className='header'>
      <div className='divForBut'><p> text1</p></div>
      <div className='divForTag'><p> text2</p></div>
      <div className='divForName'><p> text3</p></div>
      <div className='divForPhoneNum'> <p> text4</p></div>
    </div>
}

export default Header;
